function replaceValues() {

  value.forEach(e => {
    var element = document.getElementById(e.id);
    let itemValue = e.value;
    if (itemValue) {
      itemValue = itemValue.replace('<p>', '');
      itemValue = itemValue.replace('</p>', '');
    }

    element.style.cursor = "pointer"
    if (element) {
      if (element.type && element.type === 'checkbox') {
        element.checked = e.value || false;
      } else {
        element.innerHTML = itemValue;
      }
    }
    element.addEventListener("click", () => {
      Appian.Component.saveValue(SELECTION_DATA, e.id);
    })
  });
}

// Function to Read file as text
function loadFileAsText() {
  var fileToLoad = document.getElementById("fileInput").files[0];

  var fileReader = new FileReader();
  fileReader.onload = function (fileLoadedEvent) {
    var textFromFileLoaded = fileLoadedEvent.target.result;
    document.getElementById("inputTextToSave").innerHTML += textFromFileLoaded
  };

  fileReader.readAsText(fileToLoad, "UTF-8");
}

// Function to remove HTML tags
function removetHTMLTags(str) {
  if ((str === null) || (str === ''))
    return false;
  else
    str = str.toString();
  return str.replace(/(<([^>]+)>)/ig, '');
};

