function scrollToId(id, oldId) {
  var element = document.getElementById(id);
  if (oldId) {
    const oldElement = document.getElementById(oldId);
    oldElement.style.background = '#E3ECF1';
  }
  element.setAttribute("style", "scroll-margin-top: 40px");
  element.style.background = 'yellow'
  element.scrollIntoView({ behavior: 'smooth' }, false);
}

// Function to replace text in blanks
function replaceText(id, text, oldId) {

  scrollToId(id, oldId);
  var element = document.getElementById(id);
  element.innerHTML = text;
}
